package com.example.budspaces.Samples;

import android.util.Pair;

import java.util.ArrayList;
import java.util.List;
import java.util.Random;

public class CategoriesSamples {
    private List<Pair<String, String>> categories = new ArrayList<>();
    private static CategoriesSamples instance = null;

    public static CategoriesSamples getInstance() {
        if (instance == null)
            instance = new CategoriesSamples();
        return instance;
    }

    private CategoriesSamples() {
        categories.add(new Pair<>("Animal", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("Fashion", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("Food", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("Nightlife", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("People", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("Sports", "data:image/jpeg;base64,"));
        categories.add(new Pair<>("Travel", "data:image/jpeg;base64,"));
    }

    public List<Pair<String, String>> getRandomCategories(int maxCat) {
        List<Pair<String, String>> randomCat = new ArrayList<>();

        for (int i = 0; i < maxCat; i++) {
            Random r = new Random();
            randomCat.add(categories.get(r.nextInt(7)));
        }

        return randomCat;
    }
}
